  return (
    <nav>
      <ul>
        <div>
          {hidden ? (
            <li onClick={() => sethidden(false)}>Art / Design</li>
          ) : (
            <ul>
              <lh onClick={() => sethidden(true)}>Art / Design</lh>
              <li>subnav</li>
            </ul>
          )}
        </div>
        <Link to="/animation">
          <li>Animation</li>
        </Link>
        <Link to="/film">
          <li>Film</li>
        </Link>
        <Link to="/about">
          <li>About</li>
        </Link>
      </ul>
    </nav>
  );
}
